Inruar ti grupo dagiti hacker a managan iti Medusa ti datos ti rinibu a kameng ti Philippine Health Insurance Corporation (PhilHealth) dua nga aldaw kalpasan a nagkedked ti PhilHealth a mangted iti US$300,000 a ransom a dawdawaten ti nasao a grupo. Segun ken ni Renzon Cruz, maysa kadagiti security professional a mangam-amiris iti panangatakar ti Medusa iti PhilHealth, naipalaon iti 622 gigabyte a naseksek a computer files (zip files) nga inruar ti Medusa ti personally identifiable information (P
..........
) wenno computer program a pagsiim a mangatakar iti computer wenno gadget nga usaren ti mang-download ket mabalin a maapektaran ti privacy ken security daytoy. Ti pannaka-hack ti PhilHealth ti kaudian iti serye ti panangatakar kadagiti datos a mangpumpuntiria kadagiti ahensia ti gobierno ken pribado a kompania iti Filipinas. Impasingked met ti Department of Information and Communications Technology (DICT) nga igangganetget daytoy ti pannakapasayaat ti cybersecurity iti pagilian. Kinompirmar ketd
